import React from 'react';
import './Results.css';

const Results = ({ scores, answers }) => {
    const analyzeAnswers = () => {
        // Example analysis logic
        let score = 0;
        answers.forEach(answer => {
            // Increment score based on answers
            score += answer ? 1 : 0; // Adjust logic as needed
        });
        // Return insights based on score
        if (score > threshold) { // Define your threshold value
            return "You seem to be coping well!";
        } else {
            return "Consider reaching out to a mental health professional.";
        }
    };

    return (
        <div className="results-container">
            <h2>Your Results</h2>
            <p>Stress Level: {scores.stress}</p>
            <p>Anxiety Level: {scores.anxiety}</p>
            <p>Depression Level: {scores.depression}</p>
            <p>{analyzeAnswers()}</p>
            <p>
                <strong>Note:</strong> If you feel that you need immediate help, please contact a mental health professional.
            </p>
        </div>
    );
};

export default Results;
